      .blinking-text {
           width: 100%;
           text-align: center;
             margin-top: 10px;
             box-sizing: border-box;
            position: absolute;
             top: 0;
            animation: blink 1s infinite;
        }
        
        .blinking-text p {
            font-size: 35px;
            margin-bottom: 20px;
            color: green;
            
        }

        .container {
            background-color: white;
            border: 1px solid #ccc;
            border-radius: 3px;
            padding: 20px;
            width: 80%;
            max-width: 300px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            text-align: center;
            margin-top: 20px;
        }


       
        .container .footer {
            font-size: 12px;
            color: #888;
            margin-top: 20px;
        }
		
		.header {
            width: 100%;
            background-color: #038387;
            color: white;
            text-align: center;
            padding: 10px 20px;
            box-sizing: border-box;
            font-size: 18px;
            position: absolute;
            top: 0;
        }

        .header span {
            margin-left: 20px;
        }

    
    .footer {
    position: absolute;
    color: white;
    font-size: 18px;
    text-align: center;
    padding: 10px 20px;
    bottom: 0px;
    left: 0px;
    width: 100%;
    background: green;
   	color: #fff;
}
        @media (max-width: 600px) {
            .container {
                padding: 20px;
            }

            .container h2 {
                font-size: 18px;
            }

            .container .space {
                margin-bottom: 10px;
            }

            .container button {
                font-size: 14px;
            }
        }
        
        @keyframes blink {
            0% { opacity: 1; }
            50% { opacity: 0; }
            100% { opacity: 1; }
        }
    </style>
